import Footer from '../../components/Footer/Footer'

import NavManager from '../../containers/NavManager/NavManager';

const home = (props) => {
    return (
        <Aux>
            {/* <Floto/>
            <Nav/> */}
            <NavManager/>
            <Hero/>
            <SpotlightSection/>
            <Footer/>
        </Aux>
    )
}

export default home
